const Header = () => {
    return (
        <div className="jumbotron jumbotron-fluid" style={{ backgroundColor: "#d4edda", padding: "3rem 1rem" }}> 
            <div className="container text-center">
                <h1 className="display-4 text-success fw-bold">Welcome to CureWell!</h1>
                <p className="lead text-dark">
                    Your trusted healthcare platform, providing world-class medical services with top specialists.
                </p>
                <p className="text-dark">
                    Hospital Management System.
                </p>
            </div>
        </div>
    );
}

export default Header;
